import React from "react";

import {
    Card,
    CardHeader,
    CardBody,
    CardFooter,
    Typography,
    Tooltip,
    IconButton,
} from "@material-tailwind/react";

import {

    PlusIcon,


} from "@heroicons/react/24/solid";


const Profile = () => {
    return (
        <div className="flex justify-center">
            <Card className="w-full ">
                <div className="w-full flex justify-center">

                <CardHeader floated={false} className="w-80 h-80">
                    <img className="object-fill w-80 h-80"  src="https://pbs.twimg.com/profile_images/1567683362365800448/sPsU6QWt_400x400.jpg" alt="profile-picture" />
                </CardHeader>
                </div>
                <CardBody className="text-center">
                    <Typography variant="h4" color="blue-gray" className="mb-2">
                        Natalie Paisley
                    </Typography>
                    <Typography color="pink" className="font-medium" textGradient>
                        CEO / Co-Founder
                    </Typography>
                </CardBody>
                <CardFooter className="flex justify-center gap-7 pt-2">
                    <IconButton color="white" className=" shadow-none">
                        <PlusIcon className=" h-6 w-6" />
                    </IconButton>
                </CardFooter>
            </Card>

        </div>
    )

}

export default Profile;
